import React, { Component } from "react";
import Logo from "./logo.png"
import { NavLink } from "react-router-dom";
import "./css/headerAcc.css";

class HeaderAcc extends Component {
    constructor(props){
        super(props);
        this.state = {
            isVisible: false
        }
    }
    toggleVisible = () => {
        this.setState((prev) => ({ isVisible: !prev.isVisible}));
    }
    render(){
        return (
            <div className="headerAcc">
                <div className="child">
                    <div className="headerAccLogoH">
                    <NavLink to='/account'><img src={Logo} alt="TSU Logo" /></NavLink>
                        <div className="headerAccHashes">
                            <h1>თბილისის სახელმწიფო უნივერსიტეტი</h1>
                            <h1>Tbilisi State University</h1>
                        </div>
                    </div>
                    <input type="search" placeholder="Search Person" />
                    <div className="NavLinks-NavBar">
                        <NavLink to=''><span class="material-symbols-outlined">chat</span></NavLink>
                        <NavLink to=''><span class="material-symbols-outlined">notifications</span></NavLink>
                        <NavLink to=''><span class="material-symbols-outlined">account_circle</span></NavLink>
                        <NavLink to='/' id="logout"><span class="material-symbols-outlined">logout</span></NavLink>
                        <button onClick='' id="search"><span class="material-symbols-outlined">search</span></button>
                        <button onClick={this.state.toggleVisible} id="menu"><span class="material-symbols-outlined">menu</span></button>
                    </div>
                </div>
            </div>
        )
    }
}

  
  export default HeaderAcc;
